É assim que eles voltam depois de serem torturados. Cabelo, olhos, postura. Totalmente sob efeito de trauma. Sei que muitos não gostam de ver mas a guerra é real. [Tráfico humano ] Retirada de um orfanato, essa princesa já foi adotada e já tem uma família. Sra.Truth https://t.me/Mrs_Truth
@GeFazioBreakingNews 🇺🇸🇧🇷

Obrigado PR. Bolsonaro por nos fazer entender como a velha política é em suas entranhas de forma "nua e crua";
Obrigado por nos devolver o verdadeiro amor e valores pela pátria;
Obrigado PR. Bolsonaro, vc foi o melhor que já tivemos e exatamente o que precisávamos.
Mto obrigado!

2023 TMJ 👊💚💛

✅ Sigam nosso canal @nocentrodopoder e fiquem por dentro dos bastidores da política.

GIDEÕES DO BRASIL:
Vamos atravessar momentos cruciais a partir de agora. Precisamos discutir ações e planejamentos diante de possíveis acontecimentos.  Devemos sempre estar preparados para o pior, mesmo que estejamos certos da vitória imediata. 

Por isso não se assustem com a próxima postagem. Trata-se de um alerta. 

Esta será uma "daquelas vezes" que eu vou torcer para estar errado. 
Erramos por excesso ou por omissão: a primeira você se expõe; a segunda você se esconde, mas a consciência te acusa. 

Difícil escolha! Mas, como dizia o Capitão...

Pior que uma decisão mal escolhida, é uma indecisão. 

Gideão

SOBRE O PRONUNCIAMENTO DO GENERAL MOURÃO 
a ser transmitido às 20h:

1. General Mourão não é as Forças Armadas; 

2. É um excelente oficial da reserva; 

3. Suas opiniões são políticas;

4. É senador eleito e acredita ter força para anular as pautas da esquerda ao longo dos próximos 4 anos; 

5. Possivelmente vai prometer lutar pelo voto impresso e sugerir uma luta democrática em 2026 nas urnas;  

6. Quando o Ladrão foi descondenado o Congresso se calou, mas agora a culpa da omissão será colocada em nossas costas; 

7. Se preparem para o pior; 
Sejam fortes para ignorar os ataques dos desinformantes que inundarão as redes; 

8. Administradores de grupos e canais, aproveitem para bloquear sem dó e separar o joio do trigo; 

Lembrem-se do recado do Capitão: 

"Quem vai salvar o Brasil do Comunismo são o povo e as Forças Armadas". 

Amanhã pode ter 30 mil vermelhos na posse; mas precisa ter 30 milhões de patriotas nos Quartéis.  

Divulgar com urgência.

